//2. buat componen Story
// isi parameter story dengan props agar komponen jd dinamis
const Story = (props) => {
  return (
    <View style={{marginRight: 20, alignItems: 'center'}}>
      {/* 5.BUAT props di image agar gambarnya jdi dinamis dengan nama propsnya bebas props.gmbar  */}
      <Image
        source={{
          uri: props.gambar,
        }}
        style={{width: 70, height: 70, borderRadius: 70 / 2}}
      />

      {/* 3.buat props dengan nama bebas ap aja sesuai dengan komponen kita */}
      {/* 8. tambahkan maxWidth 50 karena width gambarnya 50 agar teksnya tidak kepanjangan */}
      <Text style={{maxWidth: 50, textAlign: 'center'}}>{props.judul}</Text>
    </View>
  );
};

